import React, { Component } from 'react';
import SHOP_DATA from './shop.data';
import './shop.style.scss';

class ShopPage extends Component {
    constructor(props) {
        super(props);
        this.state = {
            collections: SHOP_DATA
        }
    }
    render() {

    }
}

export default ShopPage;
